import {Switch, Route, Link} from 'react-router-dom';
import ProductOne from '../../components/product-one/product-one.component'

const Products = () => {
  return (
    <div className='Products'>
      Products
      <Switch>
        <Route exact path='/products/productOne' component={ProductOne}/>
      </Switch>
      <Link to='//products/productOne'>Wroc</Link>
    </div>
  );
}

export default Products;
